import * as React from "react";
import { View, Image, StyleSheet, Text, StatusBar} from "react-native";
import { FontSize, FontFamily, Color, Padding } from "../GlobalStyles";

const Topnav = () => {
  return (
    <View style={styles.header}>
      <StatusBar barStyle={"dark-content"} backgroundColor={"white"}/>
      <View style={styles.topnav}>
        <Image
          style={styles.downloadRemovebgPreview2Icon}
          resizeMode="cover"
          source={require("../assets/downloadremovebgpreview-2.png")}
        />
        <Text style={styles.multimediaUniversity}>{`Multimedia 
University`}</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  downloadRemovebgPreview2Icon: {
    width: 40,
    height: 31,
  },
  multimediaUniversity: {
    fontSize: FontSize.size_xl,
    fontWeight: "600",
    fontFamily: FontFamily.interSemibold,
    color: Color.black,
    textAlign: "left",
    marginLeft: 20,
  },
  topnav: {
    backgroundColor: Color.white,
    width: 393,
    flexDirection: "row",
    padding: 10,
  },
  header: {
    position: "absolute",
    top: 0,
    left: 0,
    zIndex: 2,
  },
});

export default Topnav;
